def minPath(grid, k):
    def find_paths(i, j, path, visited):
        if len(path) == k:
            paths.append(path[:])
            return
        visited.add((i, j))
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            ni, nj = i + dx, j + dy
            if 0 <= ni < len(grid) and 0 <= nj < len(grid[0]) and (ni, nj) not in visited:
                find_paths(ni, nj, path + [grid[ni][nj]], visited)
        visited.remove((i, j))

    paths = []
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            find_paths(i, j, [grid[i][j]], set())

    return min(paths)

