            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True

    def is_fibonacci(num):
        a, b = 0, 1
        while a <= num:
            if a == num:
                return True
            a, b = b, a + b
