    before_dot = file_name[:dot_index]
    after_dot = file_name[dot_index+1:]

    if not before_dot or not before_dot[0].isalpha():
        return 'No'

    if after_dot not in ['txt', 'exe', 'dll']:
        return 'No'

    return 'Yes'

