    if planet1 not in planet_positions or planet2 not in planet_positions:
        return ()

    start = min(planet_positions[planet1], planet_positions[planet2])
    end = max(planet_positions[planet1], planet_positions[planet2])

    result = [planet for planet in planets[start+1:end] if planet != planet1 and planet != planet2]
