def eat(number, need, remaining):
    total_eaten_carrots = number + remaining
    remaining_carrots = remaining - (need - number)
    if remaining_carrots < 0:
        remaining_carrots = 0
    return [total_eaten_carrots, remaining_carrots]

def do_algebra(operator, operand):
    result = operand[0]
    for i in range(len(operator)):
        if operator[i] == '+':
            result += operand[i+1]
        elif operator[i] == '-':
            result -= operand[i+1]
        elif operator[i] == '*':
            result *= operand[i+1]
        elif operator[i] == '//':
            result //= operand[i+1]
        elif operator[i] == '**':
            result **= operand[i+1]
    return result

def solve(s):
    result = ""
    has_letter = False
    for c in s:
        if c.isalpha():
            has_letter = True
            if c.islower():
                result += c.upper()
            else:
                result += c.lower()
        else:
            result += c
    if not has_letter:
        result = result[::-1]
    return result

